import React from "react";
import { Row, Col } from "react-bootstrap";

import "./card.scss";

const Card = () => {
	return (
		<CardBS>
				<Row>
					<Col xs={5} className="card-img">
						gol
					</Col>
					<Col xs={7} className="card-body">
						dsd
					</Col>
				</Row>
		</CardBS>
	);
};

export default Card;
